import React, { Component } from "react";

class Home extends Component {
  state = {};
  constructor(props) {
    super(props);
    this.state = {
      redirect: false
    };
    this.login = this.login.bind(this);
    this.onChange = this.onChange.bind(this);
  }
  render() {
    return <div>Dashboard</div>;
  }
}

export default Home;
